(function() {
    'use strict';

    function modifyBodyStyles() {
        // Select the body element with an inline style attribute
        var bodyWithInlineStyle = document.querySelector('body[style]');

        // Check if the body element with inline style exists
        if (bodyWithInlineStyle) {
            // Remove the background-image property from the inline style
            bodyWithInlineStyle.style.backgroundImage = 'none';
            // Set the background-color property to rgb(22, 34, 40)
            bodyWithInlineStyle.style.backgroundColor = 'rgb(22, 34, 40)';
        }
    }

    // Wait for the DOM to be ready
    document.addEventListener('DOMContentLoaded', modifyBodyStyles);

    // Use MutationObserver to monitor changes to the DOM
    var observer = new MutationObserver(modifyBodyStyles);
    observer.observe(document.body, { attributes: true, subtree: true });
})();